import styled from 'styled-components';
import { VerticalTimeline, VerticalTimelineElement } from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';

const Container = styled.div`
    width : 40rem;
    height : 75rem;

    @media only screen and (max-width: 800px) {
        width: 23rem;

        flex-direction : column;
    }
`

const Line = styled.hr`
    width :32rem;
    margin-bottom : 5px;
    margin-right : 5px;

    @media only screen and (max-width: 800px) {
        width: 10rem;
    }

`

function PersonalTimeLine() {

    return (
        <Container>
            <VerticalTimeline
                layout='1-column-left'>
                <VerticalTimelineElement
                    className="vertical-timeline-element--work"
                    contentStyle={{ background: 'rgb(25, 0, 51)', color: '#fff' }}
                    contentArrowStyle={{ borderRight: '7px solid  rgb(25, 0, 51)' }}
                    date="22-11-01 ~ ing"
                    iconStyle={{ background: 'rgb(25, 0, 51)', color: '#fff' }}
                // icon={<WorkIcon />}
                >
                    <h3 className="vertical-timeline-element-title">국내 범죄통계 대쉬보드</h3>
                    <h4 className="vertical-timeline-element-subtitle">■ 풀스택 개발</h4>
                    <p>
                        <Line />
                        &nbsp; &nbsp; &nbsp;- 프로젝트 투입 및 개발기간 : 2024-05-01 ~ ing<br />
                        &nbsp; &nbsp; &nbsp;- 라이브 기간 : 23-06-15 ~ ing <br />
                        &nbsp; &nbsp; &nbsp;- 사용 기술 : fastapi, react, jupyter notebook, cloudtype<br />
                        &nbsp; &nbsp; &nbsp;- 사용 언어 : python, typescript <br /><br />

                        &nbsp; ■ 프로젝트 기여내용 : <br />

                        &nbsp; &nbsp; &nbsp;- 경찰청 제공 분기별 범죄 발생 통계 데이터 전처리 <br />
                        &nbsp; &nbsp; &nbsp;- 개발서버, QA 서버 패치 및 버전 관리 <br />
                        &nbsp; &nbsp; &nbsp;- 게임 내 컨텐츠 한계돌파 컨텐츠 서버 API 개발 < br />
                        &nbsp; &nbsp; &nbsp;- QA팀 요구사항 응대 < br />< br />

                        &nbsp;&nbsp;■ 운영툴 <br />
                        &nbsp; &nbsp; &nbsp;- 유저정보를 시각화 ( 테이블 ) 화 하여 제공 <br />
                        &nbsp; &nbsp; &nbsp;- 퍼블리셔 회사에 운영툴을 제공함으로서 라이브 서비스의 편의성제공 <br />
                        &nbsp; &nbsp; &nbsp;- 게임 내 보상 지급 및 누락보상 지급에 편의성 제공<br />
                        &nbsp; &nbsp; &nbsp;- 공지 시스템과 유저차단 시스템 구축으로 주 1회 정기점검에 편의성 제공  <br />
                        &nbsp; &nbsp; &nbsp;- 운영자 활동 로그 및 보상지급 로그를 테이블화하여 비정상 보상지급 방지   <br />
                        &nbsp; &nbsp; &nbsp;- 운영자 등급에 따른 Read, Write 등급 설정 <br />

                    </p>
                </VerticalTimelineElement>
            </VerticalTimeline>
        </Container>
    )
}

export default PersonalTimeLine
